description:
Verenigde Staten
Thriller
97 minuten

geregisseerd door Bruce Beresford
met John Cusack, Morgan Freeman en Corey Johnson

Tijdens zijn begeleiding van het ziekenhuis naar de gevangenis, slaan de mannen van huurmoordenaar Frank Carden toe en deze 
komt, samen met zijn politiebegeleider in de auto te water. Ray Keene en zijn zoon Chris, die in het nabijgelegen natuurgebied 
kamperen, vinden de huurmoordenaar en Ray is vastbesloten Frank mee te nemen. Maar dan krijgt het drietal de mannen van Frank 
achter zich aan.
